import { useRecoilState } from "recoil";
import { textState } from "../recoil/recoil";


function Main() {
    const[text,setText] = useRecoilState(textState);

    const navigate = useNavigate();

  const goToNextPage = () => {
    navigate('/nextPage');
  } 

    
  return (
    <div className="App">
      <button onClick={goToNextPage}>Go to Next Page</button>
    </div>
  );
}

export default Main;
